import { Link } from 'react-router-dom';

const NavBar = ({ token, setToken }) => {

    const dropToken = () => {
        setToken(undefined);
    }

    return (
        <nav className="navbar">
            <Link to='/'> <h1>Secret Werewolf</h1> </Link>
            <div className="links">
                <Link to='/'>Home </Link>
                { !token? <> 
                          <Link to='/signin'>Sign In </Link> 
                          <Link to='/signup'>Sign up </Link> 
                          </> : 
                          <> 
                          <Link to='/listaccounts'>Leaderboard </Link>
                          <Link to='/accountdetails'>My Account </Link>
                          <Link to='/play'> <button className='button'>Play</button> </Link>
                          <button className='button' onClick={dropToken}> Sign out </button>
                          </>
                }       
            </div>
        </nav>
    );
}

export default NavBar;
